pragma solidity >=0.6.0 <0.8.0;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/Strings.sol";
import "@openzeppelin/contracts/math/SafeMath.sol";
import "./IFactoryERC721.sol";
import "./OverTheCounter.sol";
import "./StringConcat.sol";

contract OverTheCounterFactory is FactoryERC721, Ownable {
    using Strings for string;
    using SafeMath for uint256;

    event Transfer(
        address indexed from,
        address indexed to,
        uint256 indexed tokenId
    );

    address public nftAddress;
    address public minterAddress;

    string public baseURI = "https://otc-nft-api.herokuapp.com/api/otc-nft-v1/factory";
    uint256 keyToken;

    // price = basePriceUSD + (priceModifierHashCount/100) * hashCount + (priceModiferIntervalCount/100) * intervalCount + (priceModifierTotalMintedCount/100) * totalMinted
    int256 public basePriceUSD = 100;
    int256 public priceModifierHashCount;
    int256 public priceModifierIntervalCount; // (now - intervalStartUnixSeconds) / intervalLengthSeconds = priceModifierIntervalCount
    int256 public priceModifierTotalMintedCount;

    uint256 public intervalStartUnixSeconds = 1617256800; // 04/01/2020
    uint256 public intervalLengthSeconds = 86400; // 1 day

    uint256[2] public balances = [0, 0];
    uint256 public ownerBalIdx = 0;
    uint256 public minterBalIdx = 1;

    constructor(address _nftAddress) public {
        nftAddress = _nftAddress;
        minterAddress = owner();

        fireTransferEvents(address(0), owner());
    }

    function name() external override pure returns (string memory) {
        return "Over the Counter Market";
    }

    function symbol() external override pure returns (string memory) {
        return "OTCMARKET";
    }

    function supportsFactoryInterface() public override pure returns (bool) {
        return true;
    }

    function setPriceModifiers(int256 _basePriceUSD, int256 _hashCount, int256 _intervalCount, int256 _totalMintedCount) public onlyOwner {
        basePriceUSD = _basePriceUSD;
        priceModifierHashCount = _hashCount;
        priceModifierIntervalCount = _intervalCount;
        priceModifierTotalMintedCount = _totalMintedCount;
    }

    function setIntervalDetails(uint256 _intervalStartUnixSeconds, uint256 _intervalLengthSeconds) public onlyOwner {
        intervalStartUnixSeconds = _intervalStartUnixSeconds;
        intervalLengthSeconds = _intervalLengthSeconds;
    }

    function withdraw() public onlyOwner {
        executeWithdraw(ownerBalIdx, msg.sender);
    }

    function withdrawMinterFee() public {
        require(minterAddress == msg.sender, "Not authorized");
        executeWithdraw(minterBalIdx, msg.sender);
    }

    function executeWithdraw(uint256 idx, address payable _dest) private {
        uint256 _bal = balances[idx];
        if (_bal == 0) {
            return;
        }
        uint256 contractBal = address(this).balance;
        require(_bal > 0 && contractBal >= _bal);

        _dest.transfer(_bal);
        balances[idx] = 0;
    }

    function setKeyToken(uint256 _keyTokenId) public onlyOwner {
        require(keyToken == 0, "key token has already been set");
        keyToken = _keyTokenId;
    }

    // allows the owner of a specific OTC NFT to take ownership of this contract and thereby earn any profits from the duration of their ownership
    function takeOwnership() public {
        require(keyToken != 0, "key token has not been set");

        OverTheCounter overTheCounter = OverTheCounter(nftAddress);
        require (overTheCounter.ownerOf(keyToken) == msg.sender, "Not owner of key token.");

        // withdraw funds to current owner
        executeWithdraw(ownerBalIdx, payable(owner()));

        // bon voyage
        _transferOwnership(msg.sender);
    }

    function transferOwnership(address _newOwner) public override onlyOwner {
        require(_newOwner != address(0));

        transferOwnership(_newOwner);
    }

    function _transferOwnership(address _newOwner) private {
        address _prevOwner = owner();
        super.transferOwnership(_newOwner);
        fireTransferEvents(_prevOwner, _newOwner);
    }

    // used to pass ownership to the new factory; should not be used to pass ownership to a human
    function transferNFTContractOwner(address _newOwner) public onlyOwner {
        require(_newOwner != address(0));
        executeWithdraw(minterBalIdx, payable(minterAddress));

        OverTheCounter overTheCounter = OverTheCounter(nftAddress);
        overTheCounter.transferOwnership(_newOwner);
    }

    function fireTransferEvents(address _from, address _to) private {
        emit Transfer(_from, _to, 1);
    }

    function mint(address _toAddress, uint256 _tokenId) public override {
        require(minterAddress == msg.sender, "Not authorized");

        OverTheCounter overTheCounter = OverTheCounter(nftAddress);
        overTheCounter.mintTo(_toAddress, _tokenId);
    }

    function setMinter(address _newMinter) public {
        require(_newMinter != address(0));
        require(minterAddress == msg.sender, "Not authorized");
        if (balances[minterBalIdx] > 0) {
            withdrawMinterFee();
        }

        minterAddress = _newMinter;
    }

    function tokenURI(uint256 _optionId) external override view returns (string memory) {
        return StringConcat.strConcat(baseURI, Strings.toString(_optionId));
    }

    /**
     * Hack to get things to work automatically on OpenSea.
     * Use transferFrom so the frontend doesn't have to worry about different method names.
     */
    function transferFrom(
        address _from,
        address _to,
        uint256 _tokenId
    ) public {
        mint(_to, _tokenId);
    }

    /**
     * Hack to get things to work automatically on OpenSea.
     * Use isApprovedForAll so the frontend doesn't have to worry about different method names.
     */
    function isApprovedForAll(address _owner, address _operator)
        public
        view
        returns (bool)
    {
        if (owner() == _owner && _owner == _operator) {
            return true;
        }

        return false;
    }

    /**
     * Hack to get things to work automatically on OpenSea.
     * Use isApprovedForAll so the frontend doesn't have to worry about different method names.
     */
    function ownerOf(uint256) public view returns (address _owner) {
        return owner();
    }

    // payable contract so people can pay to mint NFTs
    fallback() external payable {
        uint256 totalVal = msg.value;
        uint256 ownerPortion = totalVal.mul(9).div(10);
        balances[ownerBalIdx] += ownerPortion;
        balances[minterBalIdx] += (totalVal - ownerPortion);
    }
}
